import React from 'react';
import { Link } from 'react-router-dom';
import {links, media} from '../Utils/consts';

const Navbar = () => {
    const visible = false;

    const pages = links;
    const socMedia = media;

    console.log(pages, socMedia);

    return (
        <div id='navbar'>
            <div id='logo'>
                <h1>CO. Name</h1>
            </div>
            <div id='pages'>
                {
                    pages.map((page) => {
                        return <div key={page.id}>
                            <Link to={page.link}><p>{page.name}</p></Link>
                        </div>
                    })
                }
            </div>
            <div id='socMedia' style={(visible) ? 'display: block' : 'display: none'}>
                {
                    socMedia.map((link) => {
                        return <div key={link.id}>
                            <Link to={link.link}><p>{link.name}</p></Link>
                        </div>
                    })
                }
            </div>
        </div>
    )
}

export default Navbar
